properties.description:
PORTA VENEZIA - Via Nino Bixio, libera da subito, proponiamo STANZA di 25 mq,  in appartamento di 150 mq, situato al  piano primo di uno stabile signorile con servizio di portineria intera giornata.
L'appartamento si presenta in ottime condizioni, completamente completamente arredato a nuovo ed è così composto:
- ingresso su disimpegno con porta blindata e videocitofono;
- cucina abitabile completamente arredata e fornita di tutti gli elettrodomestici;
- quattro camere da letto di cui in due troviamo un letto matrimoniale con comodino, armadio, scrivania e lavandino; nelle altre due, letto alla francese con un comodino, un armadio  e scrivania e lavandino;
- due ampi bagni finestrati con box doccia e spazio lavanderia.

Il riscaldamento è centralizzato, compreso nelle spese.

